tables.table_schema:
CREATE TABLE demographic_info ( 
    id INT PRIMARY KEY, 
    city VARCHAR(50), 
    population INT, 
    density FLOAT 
);

CREATE TABLE land_use ( 
    id INT PRIMARY KEY, 
    city VARCHAR(50), 
    land_type VARCHAR(50), 
    area FLOAT 
);

CREATE TABLE population_growth ( 
    id INT PRIMARY KEY, 
    city VARCHAR(50), 
    year INT, 
    growth_rate FLOAT 
);
